import { Breadcrumb, Layout, Menu, theme } from 'antd';
import React from 'react';
const { Header, Content, Sider } = Layout;

const Main = () => {
  return (
    <div >
        <Drawer
          variant="permanent"
          open={this.state.open}
        >
        </Drawer>
      </div>
  );
};
export {Main};
